class Solution:
    def titleToNumber(self, s):
        number, t = 0, 0
        if len(s) == 1:
            number = ord(s) - 64
        else:
            for i in s[::-1]:
                number += (ord(i) - 64) * 26 ** t
                t += 1
        return number

